<meta name="twitter:description" content="Saint Joseph's College combines classic liberal arts, career focus and rich personal attention to create well-rounded graduates. An emphasis on internships, service learning, academic support, study abroad, and faculty who like to teach as much as they like research all lead to graduates who consistently achieve success in their fields. Founded in 1912 by the Sisters of Mercy, Saint Joseph's offers more than 40 majors and concentrations on its scenic lakeside campus. A robust online program offers undergraduate and graduate degrees to adult students throughout the country and around the world.

FAST FACTS:

• 1,000 campus students

• 14:1 student-faculty ratio

• 2,500 online students

• 19 varsity teams, NCAA, Division III

• 474-acre campus on Sebago Lake in southern Maine">
